export default function createWeekOptions (weeks?: Array<number>): Array<WeekOption> {
	const out = ;

	return (weeks || new Array(53).fill(0).map((_, i) => i)).map((value) => ({
		label: `W${String(value).padStart(2, "0")}`,
		value,
	}))
}
